import React from "react";
import "./AboutMe.css";

export default function AboutMe() {
  return (
    <div className="aboutme">
      <div className="a-card">
        <div className="left">
          <img src="Assets/Skills/aboutme.jpg" />
        </div>
        <div className="right">
          <div className="desc">
            <p>
              <span>ABOUT ME</span>
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}
